import React from 'react';

class ShowReminders extends React.Component {
  /*constructor(props) {
    super(props);
  };*/

  removeReminder(e) {
    console.log('to be removed: ', e)
  }

  render () {
    if (this.props.reminders.length > 0) {
    return (
        <div>  
          <h2>Reminders</h2>
          <table> <tbody>
           {this.props.reminders.map(
              reminder =>
              <tr> 
                <td>{reminder.timestamp}</td>
                <td>{reminder.name}</td>
                <td><button onClick={this.removeReminder}>Poista</button></td>
              </tr>
              )
            }
          </tbody></table>
        </div>
      )
    } else {
      return (<div><h2>Reminders</h2></div>)
    }
  }
}

export default ShowReminders

